INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24001, 1, 0, 102601, "あたしだって\nやるときはやるよ！", 24, 1, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24002, 1, 1, 102601, "ふぅ…\nこれであたしの仕事は\n終わりだね", 24, 1, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24003, 1, 2, 102601, "終わった終わった\n一人でもなんとか\nなるもんだね", 24, 1, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24004, 2, 3, 102601, "やったね！\nこれでようやく\nサボれるよ…", 24, 2, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24005, 1, 4, 102601, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24, 1, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24006, 2, 5, 102601, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 24, 2, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24007, 2, 6, 102601, "あたしも意外と\nやるもんでしょ？", 24, 2, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24008, 4, 7, 102601, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 24, 4, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24009, 4, 8, 102601, "このままじゃ\nまっひ～に\n叱られちゃうよ", 24, 4, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24010, 4, 9, 102601, "まじめに\nやったんだけどな…\n悔しいな～", 24, 4, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24011, 4, 10, 102601, "やられた…\nねずみって意外と\nてごわいね", 24, 4, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24012, 4, 11, 102601, "おのれ～\nあたしのチーズを\n盗みやがって～！", 24, 4, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 0.0, 10040, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (24013, 4, 12, 102601, "疲れた…\nけど、次こそは\n守り抜くよ…", 24, 1, "2030/12/17 14:59:59", 0.0, "リン", "2020/04/30 12:00:00", 1.81, 10040, 0.0);
